import React from 'react';
import './App.css';
import Navbar from './components/NavBar';
import { BrowserRouter as Router, Routes, Route }
    from 'react-router-dom';
import Home from './participant_pages';
import Search from './participant_pages/search';
import Homepage from './participant_pages/homepage';
import Profile from './participant_pages/profile';
import GeneralPage from './general_page'

function App() {
    return (
        <Router>

            <Navbar />
            <Routes>
                <Route exact path='/' element={<Home />} />
                <Route path='/profile' element={<Profile />} />
                <Route path='/search' element={<Search />} />
                <Route path='/homepage' element={<Homepage />} />
                {/* <Route path='/homepage' element={<Homepage />} /> */}
            </Routes>
        </Router>
    );
}

export default App;
